  false,\n\t\"url\": null,\n\t\"notes\": \"Submerged aquatic vegetation (SAV) is an
  important habitat and site of primary production in many aquatic ecosystems but
  there was no baseline information on SAV extent or distribution in the tidal freshwater
  Hudson River. In 1994, a collaboration was initiated between the Institute of Ecosystem
  Studies (IES), the Hudson River National Estuarine Research Reserve/NYSDEC, the
  Cornell Laboratory for Environmental Applications of Remote Sensing (CLEARS), now
  the Cornell Institute for Resource Information Systems (IRIS) <http://www.css.cornell.edu/iris/index.htm>.
  In addtion, the New York Sea Grant, the Hudson River Estuary Program, and the National
  Oceanic and Atmospheric Administration (NOAA) are identified as partners. These
  groups provided diverse expertise to enable the first broad delimitation of SAV
  in the Hudson.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
